import React from 'react';
import styles from './header.module.css';

const Header = (props) => {

    return(
        <>
        <nav className={styles.navbar}>
        <div className={styles.navbar__logo}>
            <a href="#">BookShare</a>
        </div>
        <div className={styles.navbar__menu}>
            <ul className={styles.navbar__menu}>
                <li className={styles.navbar__menu__item} data-link="#best">Best</li>
                <li className={styles.navbar__menu__item} data-link="#steady">Steady</li>
            </ul>
        </div>
        <button className={styles.navbar_toggle_btn}>Login</button>
    </nav>
    </>
    )
};

export default Header;
